tables.table_schema:
CREATE TABLE Celebrities (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    nationality VARCHAR(255)
);

CREATE TABLE Movies (
    id INT PRIMARY KEY,
    title VARCHAR(255),
    release_date DATE
);

CREATE TABLE followers (id INT PRIMARY KEY,
  follower_id INT REFERENCES celebrities(id),
  following_id INT REFERENCES celebrities(id));

CREATE TABLE Celebrities (
  id SERIAL PRIMARY KEY,
  name VARCHAR(100) NOT NULL,
  age INTEGER,
  nationality VARCHAR(50)
);
